(57,	13,	'2019-09-05 10:45:47',	'2019-09-05 10:45:47',	'As-salmu alaykum,\r\nBr. Shoib is young and talented brother from Gorabarik village Uttar Pradesh who used to work in Kuwait in an Air Condition Repair company, He met with an accident when he was travelling to attend an Ijtema, The bus he was travelling flipped upside down after colliding with an vehicle, His right arm came under bus window and got crushed severely, Its been 3 years since the accident took place and Br. Shoib has recovered from his injuries but his right arm is not useful anymore.\r\n\r\nBr. Shoib recently got married and he is struggling to meet his day to day expense.\r\nHe is appealing for help to setup a small grocery shop where he can make his living without depending on others.\r\n\r\nWe are asking generous people to come-forward and help him to setup his shop.\r\nYou can contact IMA at 67696747\r\n\r\nJazakallah Khair',	'Br. Shoib needs our help',	'As-salmu alaykum,\r\nBr. Shoib is young and talented brother from Gorabarik village Uttar Pradesh who used to work in',	'publish',	'closed',	'closed',	'',	'br-shoib-needs-our-help',	'',	'',	'2019-09-17 11:22:30',	'2019-09-17 11:22:30',	'',	0,	'http://www.aaasra.com/?post_type=fundraiser&#038;p=57',	0,	'fundraiser',	'',	0),
