(208,	13,	'2019-09-29 02:16:23',	'2019-09-29 02:16:23',	'<span style=\"font-weight: 400;\">Aaasra is a brainchild of K. M. Shareef Charitable Trust. The Vision &amp; Mission is Empowering the Community &amp; Uplifting the underprivileged. Aaasra intends to make a difference with effective use of Zakat &amp; Charity to support education, short term &amp; permanent disabilities. Below are details of the programs that Aaasra intends to support</span>\r\n\r\n<b>Education - </b><span style=\"font-weight: 400;\">Support/Sponsor highly talented students in the below fields</span>\r\n<ul>\r\n 	<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Administration Services</span></li>\r\n 	<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Police Services</span></li>\r\n 	<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Law</span></li>\r\n 	<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Journalism/Mass communication</span></li>\r\n 	<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Medicine &amp; Engineering</span></li>\r\n</ul>\r\n<b>Permanent Disabilities</b>\r\n<ul>\r\n 	<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Monthly allowances for widows &amp; single mothers</span></li>\r\n 	<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Medical allowances for chronic ailments.</span></li>\r\n 	<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Ad-Hoc requests for medical &amp; other support</span></li>\r\n</ul>\r\n<b>Short-term Disabilities</b>\r\n<ul>\r\n 	<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Empowering Zakat recipients towards self-reliance</span></li>\r\n 	<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Short Term Loans</span></li>\r\n 	<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">One time investment</span></li>\r\n 	<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Business Suggestions</span></li>\r\n 	<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Job Assistance</span></li>\r\n 	<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Marriage Assistance</span></li>\r\n 	<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Funding lawyers to fight hate crimes, Riots</span></li>\r\n</ul>',	'About Us',	'',	'publish',	'closed',	'closed',	'',	'about-us',	'',	'',	'2019-09-29 02:16:23',	'2019-09-29 02:16:23',	'',	0,	'http://www.aaasra.com/?page_id=208',	0,	'page',	'',	0),
