(228,	17,	'2019-11-23 16:39:37',	'2019-11-23 16:39:37',	'&nbsp;\r\n\r\n&nbsp;\r\n\r\nA family of a widow residing in a rented house at Valachil Padavu, Srinivas College Road, Mangalore Taluk is in dire need of help.\r\n\r\nThe family consisting of a widow and her four daughters are suffering from severe financial crisis as there is no breadwinner among them.The four daughters are pursuing Arabic teachers training course, 2nd PUC, 1st PUC and class IX respectively. They are unable to pay the house rent of 3500 and the payment stays pending for the past few months.The family is in immediate need of financial support to construct a house for themselves as they are not able to continue any more in the rented house.\r\n\r\nThe cost is approximately 7 Lakhs.\r\n\r\nMoreover the eldest daughter is now getting proposals for marriage which will invite more financial burden and that has put the family in great distress. We request you to join hands with us in relieving the family of this distress by donating towards fulfilling the family\'s immediate needs.\r\n\r\n&nbsp;\r\n\r\nMay the Almighty bless you abundantly.',	'Help this widow build her house',	'',	'publish',	'closed',	'closed',	'',	'help-this-widow-build-her-house',	'',	'',	'2019-11-23 16:46:08',	'2019-11-23 16:46:08',	'',	0,	'https://www.aaasra.com/?post_type=fundraiser&#038;p=228',	0,	'fundraiser',	'',	0),
